void OAIPermissionApi::putPermissionTag(const QString &permission_id, const QString &tag_id, const QString &authorization, const QString &api_version) {
    QString fullPath = QString(_serverConfigs["putPermissionTag"][_serverIndices.value("putPermissionTag")].URL()+"/Permission/{PermissionId}/Tag/{TagId}");
    
    
    {
        QString permission_idPathParam("{");
        permission_idPathParam.append("PermissionId").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "PermissionId", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"PermissionId"+pathSuffix : pathPrefix;
        fullPath.replace(permission_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(permission_id)));
    }
    
    {
        QString tag_idPathParam("{");
        tag_idPathParam.append("TagId").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "TagId", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"TagId"+pathSuffix : pathPrefix;
        fullPath.replace(tag_idPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(tag_id)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "PUT");


    
    {
        if (!::OpenAPI::toStringValue(authorization).isEmpty()) {
            input.headers.insert("Authorization", ::OpenAPI::toStringValue(authorization));
        }
        }
    
    {
        if (!::OpenAPI::toStringValue(api_version).isEmpty()) {
            input.headers.insert("Api-Version", ::OpenAPI::toStringValue(api_version));
        }
        }
    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIPermissionApi::putPermissionTagCallback);
    connect(this, &OAIPermissionApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

